import React from 'react';
import bg19 from '../img/bg19.jpg';
import '../styles/voluntario.css';
import { FacebookOutlined, TwitterCircleFilled,InstagramFilled } from '@ant-design/icons';
import 'antd/dist/antd.css';
import { Input } from 'antd';
import dep0 from '../img/dep0.jpeg';
import dep1 from '../img/dep1.jpg';

const { TextArea } = Input;


export default function Voluntario() {
 return (
   <div className="ffullpage" style={{ backgroundImage: `url(${bg19})` }}>
     <div className="join"><h1>Torne-se um voluntario.</h1></div>       
       <div className="vfull">
         <h1>Faça parte do nosso time.</h1> 
         <h2>O projeto Visão Social tem experiência com voluntariado internacional, desde o ano de 2016 já recebeu voluntários da Colômbia, Peru, México, Argentina, Inglaterra, Holanda, China, Paquistão e Estados Unidos.
Se você deseja desenvolver um trabalho voluntário no Projeto Visão Social entre em contato conosco.
</h2>
         <div className="cadv">
           <p>Nome:</p>
         <Input placeholder="Digite seu nome" />
         <p>E-mail</p>
         <Input placeholder="E-mail" />
         <p>Telefone</p>
         <Input placeholder="Telefone" />
         <p>Endereço</p>
         <Input placeholder="Enderço" />
         <p>Idade</p>
         <Input placeholder="Idade" />
         
         <div className="txta"><p>Qual seu interesse em se tornar um voluntario?</p><TextArea rows={4} /></div>

        </div> 
        <div className="depoimentos">
          <div className="cd">
          <img src={require('../img/dep0.jpeg')} />
              <p>oi</p>
          </div>
        </div>
        <div className="footer"><h5>© Copyright 2022 Projeto Visão Social - All Rights Reserved</h5></div>       
      </div>
      

   </div>
 );
}
